description:
Michael Hordern and Richard Briers star as Jeeves and Wooster in six BBC Radio 4 full-cast dramatisations. Also featuring Maurice Denham, Paul Eddington, David Jason, John Le Mesurier, Miriam Margolyes, Jonathan Cecil, Liza Goddard and Patrick Cargill. The Inimitable Jeeves - Aunt Agatha is forcing Bertie to get engaged to the formidable Honoria Glossop. Can Jeeves save the day? The Code of the Woosters - Who would think that a silver cow-creamer could cause so much trouble? Uncle Tom wants it, and Aunt Dahlia is blackmailing Bertie to steal it. Right Ho, Jeeves. Mayhem has broken out at Brinkley Court, but there are more brains in the Wooster household than just Jeeves...Stiff Upper Lip, Jeeves - Poor Bertie! Madeline Bassett and Gussie Fink-Nottle's engagement is on the rocks, and he's next in line for the fair maiden's hand. Jeeves and the Feudal Spirit - When Jeeves returns from his annual shrimping holiday in Bognor Regis, he's in for a few surprises. Jeeves: Joy in the Morning - For Bertie, Steeple Bumphleigh is a village to be avoided as it contains the appalling Aunt Agatha. Still, there are good deeds to be done. '...a joy from first to last, delivered with absolutely the right lightness of touch, full of fun, trivial yes, but utterly enhanting' - &quot;Chichester Observer&quot;.
